script: |
  super -f text -I q7453.spq | sort > q7453.out

inputs:
  - name: q7453.spq
    data: |
      SELECT DISTINCT + - col1 AS col2, col2 col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN - col1 * col2 + - CAST ( NULL AS REAL ) * - CAST ( col0 AS INTEGER ) + + + 85 * + - col2 AND + + col1;
  - name: tab2

outputs:
  - name: q7453.out
    data: |
